import React from 'react'

import { CardContainer, CardHeadin, CardImage } from './ProjectCard.styles'

const ProjectCard = (props) => {

  return (
    <CardContainer>
    <CardHeading />
    <CardImage src={props.source} />
    </CardContainer>
  )
}

export {ProjectCard}
